(1, 'El futbol a sol y sombra', 'Eduardo Galeano', 'Deporte', 1995, '0', 'En el artículo «El fútbol a sol y sombra: Un análisis literario detallado por Eduardo Galeano», se explora la pasión y la complejidad del fútbol a través de la pluma del reconocido escritor uruguayo. Galeano, conocido por su habilidad para tejer historias y reflexiones profundas, desentraña los aspectos más profundos de este deporte que trasciende fronteras y culturas. A través de un análisis detallado, el autor examina la relación entre el fútbol y la sociedad, destacando su capacidad para unir y dividir a las personas, así como su reflejo de las desigualdades y luchas políticas', 1, , '2024-11-18 16:33:03', '2024-11-18 21:17:07');
INSERT INTO `libros` (`id`, `titulo`, `autor`, `genero`, `año_publicacion`, `isbn`, `descripcion`, `disponible`, `archivo_pdf`, `creado_en`, `actualizado_en`) VALUES
(3, 'El peligro de la historia única', 'CHIMAMANDA NGOZI ADICHIE', 'Ensayo', 2009, '978', 'Un análisis literario detallado por Chimamanda Ngozi Adichie» explora la importancia de no caer en la trampa de creer en una única narrativa sobre un determinado grupo de personas o cultura. La autora, Chimamanda Ngozi Adichie, una reconocida escritora nigeriana, argumenta que cuando solo se escucha una versión de la historia, se corre el riesgo de perpetuar estereotipos y prejuicios.', 1, , '2024-11-20 17:54:19', '2024-11-20 21:33:59');
INSERT INTO `libros` (`id`, `titulo`, `autor`, `genero`, `año_publicacion`, `isbn`, `descripcion`, `disponible`, `archivo_pdf`, `creado_en`, `actualizado_en`) VALUES
(4, 'Las venas abiertas de América Latina', 'Eduardo Galeano', 'Ensayo', 1971, '1234', 'Las venas abiertas de América Latina, escrito por el reconocido autor uruguayo Eduardo Galeano, es una obra fundamental que aborda la historia y las problemáticas socioeconómicas de América Latina desde la época de la colonización hasta el presente.', 1, '', '2024-11-20 21:21:55', '2024-11-20 21:35:59');

